import React from 'react';

const Profile = () => {
  const user = {
    name: "John Doe",
    interests: ["Coding", "Music", "Sports"],
    clubs: ["Coding Club", "Music Club"],
  };

  return (
    <div>
      <h1>{user.name}</h1>
      <h3>Interests</h3>
      <p>{user.interests.join(', ')}</p>
      <h3>Clubs</h3>
      <ul>
        {user.clubs.map((club, index) => (
          <li key={index}>{club}</li>
        ))}
      </ul>
    </div>
  );
};

export default Profile;
